import { NavLink, Outlet } from "react-router-dom";

function PaymentPage() {
  return (
    <>
      {" "}
      <center>
        {" "}
        <div className="col-md-3 payment-page-container">
          <div className="col-md-5 logo-holder col-6">
            {" "}
